(9,	9,	'20c4ede5-b559-4309-8fa3-545e49562ae4',	'Fareskilt batterigass',	'fareskilt-batterigass',	NULL,	75,	'30000',	'24052985712Fareskilt---Batterigass-kan-forekomme.jpg',	'<p>test 1</p>',	'<p>test 2</p>',	NULL,	1,	0,	0,	NULL,	NULL,	NULL,	'2024-06-20 12:41:15',	'2024-06-20 07:11:15'),
(12,	5,	'56e7965d-1fe4-4255-b9ad-795470c156d7',	'Parkering forbudt skilt ‚Äì Forbudsskilt med symbol',	'parkering-forbudt-skilt-forbudsskilt-med-symbol',	NULL,	79,	'P88876',	'240531124711Screenshot_from_2024-05-31_15-22-56.png',	'<p>Parkering forbudt skilt forteller at det ikke er tillatt &aring; parkere p&aring; omr&aring;de. Dette skiltet passer veldig godt til alle steder hvor det er forbudt &aring; parkere.</p>\r\n\r\n<p><strong>St&oslash;rrelse:&nbsp;</strong>297 x 210 (A4) / 297x420mm ( A3 ) / 50x70cm / 70x100cm<br />\r\n<strong>Materiale: 2mm </strong>Aluminium, 3mm aluminium kompositt,&nbsp; Selvklebende</p>',	'<h2><strong>Parkering forbudt skilt &ndash; Velg riktig forbudsskilt</strong></h2>\r\n\r\n<p>Parkering forbudt skilt forteller at det ikke er tillatt &aring; parkere p&aring; omr&aring;de. Dette skiltet passer veldig godt til alle steder hvor det er forbudt &aring; parkere. Alle v&aring;re forbudsskilt leveres med korrekte symboler og forklarende tekst.</p>\r\n\r\n<p>Alle Ekstraskilt.no sine forbudsskilt oppfyller kravene i ISO 7010. Standarden bestemmer utformingen og fargen p&aring; forbudsskilt. Form&aring;let med standarden er at forbudsskiltet skal v&aelig;re lett &aring; kjenne igjen og forst&aring;, uansett nasjonalitet og spr&aring;k.</p>\r\n\r\n<p>Ekstraskilt.no har lang erfaring med denne type skilt og s&oslash;rger alltid for at skiltene inneholder korrekte symboler og tekst. Alle forbudsskilt produseres for lang holdbarhet i nordiske forhold. De leveres i 4 forskjellige materialer til forskjellig pris.</p>\r\n\r\n<p><a href=\"https://www.ekstraskilt.no/kontakt-oss/\">Trenger du hjelp med skilt? Ta kontakt med oss her (Vi svarer garantert innen 12 timer)</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Montering av forbudsskilt?</strong></h3>\r\n\r\n<p>Forbudsskilt monteres ofte ved hjelp av selvklebende tape eller skruer. Det du b&oslash;r tenke p&aring; er at skiltet b&oslash;r monteres slik at det er lettest &aring; f&aring; &oslash;ye p&aring;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Prisgaranti</strong></h3>\r\n\r\n<p>Vi er veldig trygge p&aring; at vi leverer de beste skiltene til de laveste prisene. Derfor tilbyr vi prisgaranti. Finner du ett produkt som er helt identisk med v&aring;re produkter, sender du oss link til produktet &ndash; Dersom det kvalifiserer for garantien, gir vi n&oslash;yaktig samme pris.</p>',	NULL,	1,	0,	0,	NULL,	NULL,	NULL,	'2024-06-04 20:30:52',	'2024-06-04 20:30:52');
